import { useDispatch } from "react-redux";
import {toggleTabs} from '../redux/action/index'
const Tabs = () => {

    const dispatch =useDispatch();
    return (
        <>
        {
           TABS.map(tab =>(
            <button className="tab_button"
            onClick={()=> dispatch(toggleTabs(tab))}>
                  {tab}
            </button>
           ))  
        }
       
        </>
    )
}

export default Tabs ;
